import React from "react";
import TemplateAnime from "../Elementos/templateAnime"


function OnePiece(){
    return(
        <div>
            <TemplateAnime LinkAnime="https://iframe.mediadelivery.net/embed/49031/e8004cd9-e395-4311-8cf1-eb803fd07844?autoplay=true" TituloAnime="One Piece " TituloCap="Episodio 1 – ¡Soy Luffy! ¡El hombre que se convertirá en el Rey de los Piratas!" DescAnime="Comienzan las andanzas de Monkey D. Luffy, un joven de goma que afirma que se convertirá en el Rey de los Piratas. Conoce a Coby por accidente durante el asalto de la pirata Alvida y huyen juntos."/>
        </div>
    );
}

export default OnePiece;
